import React from 'react';



const johnnyBio = "https://api.themoviedb.org/3/discover/movie?api_key=" + process.env.REACT_APP_API_KEY + "&language=en-US&sort_by=popularity.desc&include_adult=true&include_video=false&page=1"

// Then we'll fetch user data from this API
const getJohnnysBioTask = async () =>
  await fetch(johnnyBio)
    .then(res => (res.ok ? res : Promise.reject(res)))
    .then(res => res.json())

const Bio = () => {

